(window.webpackJsonp=window.webpackJsonp||[]).push([[22],{280:function(module,exports){module.exports={compilerOutput:[],storyContent:{inkVersion:19,root:[[{"->t->":"chapter_04_sound"},{"->t->":"chapter_04_intro"},{"->t->":"chapter_04_first_question"},{"->t->":"chapter_04_second_question"},{"->t->":"chapter_04_third_question"},{"->t->":"chapter_04_fourth_question"},{"->t->":"chapter_04_fifth_question"},{"->t->":"chapter_04_sixth_question"},{"->t->":"chapter_04_outro"},"ev","str","^","/str","/ev",{"->":"done"},["done",{"#f":5,"#n":"g-0"}],null],"done",{chapter_04_sound:['^<play-sound group="music" name="stranger-danger" />',"\n","ev","void","/ev","->->",{"#f":1}],chapter_04_intro:[["^<p>","\n","^\"Hi Hank. It's great to finally meet you, I'm Salome.\"","\n","^</p>","\n",["ev",{"^->":"chapter_04_intro.0.6.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Pleased to meet you."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_intro.0.7.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"Have I met you before?"',{"->":"$r",var:!0},null]}],"ev","str",'^"..."',"/str","/ev",{"*":".^.c-2",flg:20},{"c-0":["ev",{"^->":"chapter_04_intro.0.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.6.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^I walk over to her, reaching out my right hand. She takes it warmly, then drops her hand back to her side.","\n","^</p>","\n","^<p>","\n",'^"Thank you, Hank."',"\n","^</p>","\n","^<p>","\n",'^"No problemo."',"\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_intro.0.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.7.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"No, but you may have seen me around. My main role here is to serve as one of the head nurses, so I'm out and about a lot. It's possible you saw me bring someone in from intake while you were waiting?\"","\n","^</p>","\n","^<p>","\n",'^"Aha. That must be it, yes."',"\n","^</p>","\n","ev",{"VAR?":"confused_score"},1,"+",{"VAR=":"confused_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-2":["\n","^<p>","\n",'^Salome fills in what I would not. "Pleased to meet you too, Salome."',"\n","^</p>","\n","^<p>","\n","^She mimes shaking her own hand.","\n","^</p>","\n","^<p>","\n",'^"Hmph. No fair."',"\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"g-0":["^<p>","\n",'^"Sit down. Take a minute to relax. I\'ll just go ahead and fasten all these leads. Clip this to your hand... wrap this around your chest, looking like a bit of healthy growth there\u2014"',"\n","^</p>","\n",["ev",{"^->":"chapter_04_intro.0.g-0.6.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-3",flg:18},{s:['^"Huh?"',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_intro.0.g-0.7.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-4",flg:18},{s:['^"What does that mean?"',{"->":"$r",var:!0},null]}],"ev","str",'^"..."',"/str","/ev",{"*":".^.c-5",flg:20},{"c-3":["ev",{"^->":"chapter_04_intro.0.g-0.c-3.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.6.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Oh, nothing, just talking to myself. I thought I saw you at intake the other day, you looked skinny, I guess I misremembered. Sorry! I'll keep my mouth shut until I'm done.","\n","^</p>","\n","ev",{"VAR?":"confused_score"},1,"+",{"VAR=":"confused_score",re:!0},"/ev",{"->":".^.^.^.g-1"},{"#f":5}],"c-4":["ev",{"^->":"chapter_04_intro.0.g-0.c-4.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.7.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"It, uhh. Oh, right. Stupid. Nothing. I just haven't had coffee yet. You look very healthy, Hank. Sorry to be such a mushmouth about it, I promise it's all me.","\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.^.g-1"},{"#f":5}],"c-5":["\n","^<p>","\n","^\"Almost through with this. The clasps are always... tight. This one's fighting me.","\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.^.g-1"},{"#f":5}],"#f":5}],"g-1":["^<p>","\n","^Aaaand we're done. Take a minute to breathe and then we'll start. No shocks or pokes, I swear.\"","\n","^</p>","\n","^<p>","\n","^She giggles a bit, too quiet to be for show, then turns to the console. She pushes several buttons with a serious expression.","\n","^</p>","\n","ev","void","/ev","->->",{"#f":5}]}],{"#f":1}],chapter_04_first_question:[["^<p>","\n","^\"Okay. First question is impossible to fail. Everyone passes, really. So, answer each of these with a yes or no question. Got it? That's not the first question, it's rhetorical.\"","\n","^</p>","\n","^<p>","\n",'^"Uh huh."',"\n","^</p>","\n","^<p>","\n",'^"First question: is your birth name Hank Holder?"',"\n","^</p>","\n",["ev",{"^->":"chapter_04_first_question.0.18.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Yes."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_first_question.0.19.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"No."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_first_question.0.20.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"Technically, it\'s Henry."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_first_question.0.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.18.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Great. Thank you. You're doing perfectly.","\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_first_question.0.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.19.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Well, the system is definitely working. But that's a true negative. And, Hank, this is where I deliver my spiel. If you really, really don't want to work with us... don't. We're not jailers, and we're not torturers. The door is right there.","\n","^</p>","\n","^<p>","\n","^I'll be sad to watch you go, but no one's going to prevent it. And no one, though I hope this should precede us in our reputation and how you've been treated thus far, will come in the night, with a potato sack and an assault syringe, to steal you back.","\n","^</p>","\n","^<p>","\n","^It's just too clich\xe9 for us, and I'd like to think we're at least a bit cooler than that. More 'new religious movement' than 'mystery cult.' Just a new way of doing good, by getting in touch with the old ways. I promise.\"","\n","^</p>","\n","^<p>","\n",'^"Got it, five by five."',"\n","^</p>","\n","^<p>","\n",'^"I wouldn\'t be here if this was really about world domination, extraordinary rendition, or experimental mind control. No disrespect to the rockstars of cultism, they surely get enough already, but my story is domestic and simple."',"\n","^</p>","\n","^<p>","\n",'^"Glad to hear there\'s no skunkworks brain-bending cocktail or a suicide belt at the end of this."',"\n","^</p>","\n","^<p>","\n","^\"Not from me, anyway. That's Father's and Lystra's departments, respectively. And <em>that</em> was a joke, just in case it wasn't clear.\"","\n","^</p>","\n","^<p>","\n",'^"It was."',"\n","^</p>","\n","^<p>","\n",'^"The point stands. Make your choice, Mr. Housecat. In or out?"',"\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",[["ev",{"^->":"chapter_04_first_question.0.c-1.67.0.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Okay, I\'m out."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_first_question.0.c-1.67.1.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"Well, you\'ve got me for now."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_first_question.0.c-1.67.2.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"Sorry. Just got mixed up."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_first_question.0.c-1.67.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.0.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"What I came here for was <em>drugs</em>. This..."',"\n","^</p>","\n","^<p>","\n","^Now I spread my arms wide, pointing to the faceless and bleak metal walls, no adornments or beauty, just a silly flag for a nation which doesn't exist and never will.","\n","^</p>","\n","^<p>","\n","^\"...is not. This isn't drugs. Being interviewed while being hooked up to a laptop is not drugs. It's nowhere close to drugs. I came in here with a headache and somehow y'all have harshed on that like a mellow. You're a very weird hippie, I don't like hippies, and I'm so gone it's not even funny.\"","\n","^</p>","\n","^<p>","\n","^I get up and storm out. Of course I'm not mad. It's just another failed score in a long line, and that I have grown fine with losing at, as long as the hit rate stays high enough. And sometimes, every so often, after I smash my way out of a situation like this, someone will dangle a morsel out the window to get me back. We will see whether they actually think me special, and what sort of treats their Mother offers favored sons made in her image.","\n","^</p>","\n","ev","str","^chapter-negative-1","/str","/ev",{"->":"done"},{"->":".^.^.^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_first_question.0.c-1.67.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.1.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Just an hour more.\" I wink to sell it. She sells it right back, so naturally I still can't tell whether she cares about this at all. Maybe it's just a job, and an odd narcissist of a boss, like any other under the sun. What's more ordinary than people paid less than they deserve to smile at snarky drug-seekers and lorded over by someone who thinks themself an ascended lifeform?","\n","^</p>","\n",{"->":".^.^.^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_first_question.0.c-1.67.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.2.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"I have test anxiety."',"\n","^</p>","\n","^<p>","\n","^\"It's okay. You can think of it less like a psychometric test, which might aim to quantify your general and specific intelligences, and more like an allergy test, where we give you a few common injury-substances in such small doses as to be nearly homeopathic, and note where it gets a bit red. Hasn't even needed a needle in a century or more. Won't hurt a bit, pinky swear.\"","\n","^</p>","\n","^<p>","\n",'^"And here I was thinking renunciants in plaguetime would be beyond the simple pinky swear."',"\n","^</p>","\n","^<p>","\n",'^"Not yet, friend.',"\n","^</p>","\n",{"->":".^.^.^.^.g-0"},{"#f":5}]}],{"#f":5}],"c-2":["ev",{"^->":"chapter_04_first_question.0.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.20.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Okay. Hank\u2014 Henry. I appreciate the level of detail, but it needs to be simpler than that for the readout to work. We're not looking for fidelity, just a few binary numbers. This will be marked as a yes, and a pass. I will omit, this one time, the yellow asterisk denoting a moderate pass. Just 'cause I like you. But detail-orientation can conceal neurosis and illness, so it's relevant.\"","\n","^</p>","\n","^<p>","\n","^\"A test failed in trying too hard. Marvelous. I'm sure I'll do great, it matches a core competency.\"","\n","^</p>","\n","ev",{"VAR?":"confused_score"},1,"+",{"VAR=":"confused_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"g-0":["ev","void","/ev","->->",{"#f":5}]}],{"#f":1}],chapter_04_second_question:[["^<p>","\n","ev",{"CNT?":"chapter_04_first_question.0.c-2"},"!","/ev",[{"->":".^.b",c:!0},{b:['^"',{"->":".^.^.^.7"},null]}],"nop",'^You were born at the Colonial Hospital of Capital. You grew up, primarily, at 61372 Leaside Court, in the Davistown neighborhood of the colonial palace zone."',"\n","^</p>","\n",["ev",{"^->":"chapter_04_second_question.0.12.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"No, that doesn\'t sound right."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_second_question.0.13.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"That wasn\'t the name of the capital."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_second_question.0.14.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"Yes."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_second_question.0.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.12.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"confused_score"},.5,"+",{"VAR=":"confused_score",re:!0},"/ev","^<p>","\n","^\"Okay. Well, that's what it says on the sheet. Can you offer more than that? It looks like we may be approaching the hard fail line, which is useful data. It's just, uh... quite early for a total fail.","\n","^</p>","\n",[["ev",{"^->":"chapter_04_second_question.0.c-0.19.0.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"How do I fail for saying my address is wrong?"',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_second_question.0.c-0.19.1.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"Sorry."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_second_question.0.c-0.19.2.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"I\'m not sure what to say."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.0.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"resister_score"},.5,"+",{"VAR=":"resister_score",re:!0},"/ev","^<p>","\n","^\"It's not so much failure in the sense of doing something wrong, don't worry. It's more just that if all the answers are 'No' or 'I don't know,' then we have no baseline to test. We surface no data.\"","\n","^</p>","\n","^<p>","\n",'^"Ah."',"\n","^</p>","\n","^<p>","\n","^\"I'll just mark it down as a confound instead. And on to the next question.","\n","^</p>","\n",{"->":".^.^.^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.1.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"convert_score"},.5,"+",{"VAR=":"convert_score",re:!0},"/ev","^<p>","\n","^\"That's fine. I'll just go ahead and mark this down as a confound instead. And on to the next question.","\n","^</p>","\n",{"->":".^.^.^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.2.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"confused_score"},.5,"+",{"VAR=":"confused_score",re:!0},"/ev","^<p>","\n",'^"That\'s fine. Can you at least confirm you lived in Davistown?"',"\n","^</p>","\n",[["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-2.19.0.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Yes."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-2.19.1.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"No."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-2.19.2.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"I can\'t remember that far back."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-2.19.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.0.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"convert_score"},.5,"+",{"VAR=":"convert_score",re:!0},"/ev","^<p>","\n","^\"Thank you. This one goes in as a... soft pass, and we're done, and moving on.","\n","^</p>","\n",{"->":".^.^.^.^.^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-2.19.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.1.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"resister_score"},.5,"+",{"VAR=":"resister_score",re:!0},"/ev","^<p>","\n",'^"Thank you. Moving on.',"\n","^</p>","\n",{"->":".^.^.^.^.^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_second_question.0.c-0.19.c-2.19.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.2.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"confused_score"},.5,"+",{"VAR=":"confused_score",re:!0},"/ev","^<p>","\n","^\"That's fine. I'll mark it down as a confound instead of a fail, and we can move on to the next question.","\n","^</p>","\n",{"->":".^.^.^.^.^.^.g-0"},{"#f":5}]}],{"#f":5}]}],{"#f":5}],"c-1":["ev",{"^->":"chapter_04_second_question.0.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.13.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"It was a colonial name, for a colonial government. But yes."',"\n","^</p>","\n","^<p>","\n","^\"That one gets an asterisk. I don't really care, I swear I don't, I'm just here to help. But in this case the helping word is this. We can't tell you how to be well if you don't want to be. There's no magic other than that, it's just being willing to submit, for an hour, a year, or a lifetime, totally your choice, to a certain flavor of self-examination.\"","\n","^</p>","\n","^<p>","\n","^There's the upsell. Knew she was a pro. Wonder if they have a downline for indulgences? Like maybe when retirement rolls around she gets an even fancier diamond vehicle if she brings in more than 144,000 converts?","\n","^</p>","\n","^<p>","\n",'^"I can see you thinking, you know. We\'ll go to the next question now."',"\n","^</p>","\n","^<p>","\n","^Oops.","\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_second_question.0.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.14.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Superb. Thank you. On to the next question.',"\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"g-0":["ev","void","/ev","->->",{"#f":5}]}],{"#f":1}],chapter_04_third_question:[["^<p>","\n","ev",{"CNT?":"chapter_04_second_question.0.c-1"},"/ev",[{"->":".^.b",c:!0},{b:['^"',{"->":".^.^.^.6"},null]}],"nop",'^You are currently sitting in a room inside a hospital operated by the TAV Institute."',"\n","^</p>","\n",["ev",{"^->":"chapter_04_third_question.0.11.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"No, I\'m floating in space."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_third_question.0.12.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"That is correct."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_third_question.0.13.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:["^I fake a headache.",{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_third_question.0.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.11.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Very funny. But we could tell if you were that high. You'd never have moved on here, you'd be like a comatose interviewee. So I am marking that down as a hard failure, with a note that you're the one exciting yourself.\"","\n","^</p>","\n","^<p>","\n","^\"Oh, I would never. It's a sin to excite one's self, after all.\"","\n","^</p>","\n","^<p>","\n","^\"Perhaps we should have a stand-up night. You'd pass that one with flying colors, I'm sure.\"","\n","^</p>","\n","^<p>","\n",'^"And how about that cafeteria food, ladies and gents?"',"\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_third_question.0.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.12.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Excellent. Another one down, and quick. We\'ll have an early dinner yet."',"\n","^</p>","\n","^<p>","\n",'^"Cornbread again, heavenly matriarch willing."',"\n","^</p>","\n","^<p>","\n","^\"There's the spirit. We'll make a Perfect of you yet, Hank.","\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_third_question.0.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.13.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^Nothing sells better than pain, and I'm disinterested in playing like a lapdog. So I screw up my face and grit my teeth.","\n","^</p>","\n","^<p>","\n","^\"Are you okay, Hank? I'm getting a weird spike over here, and you're, well, grimacing.\"","\n","^</p>","\n","^<p>","\n",'^"Yeah. Just. Need. A few seconds."',"\n","^</p>","\n","^<p>","\n",'^"Of course. Take your time. And let us know if you need anything for the pain."',"\n","^</p>","\n","^<p>","\n","^Jackpot. I see gold.","\n","^</p>","\n","^<p>","\n","^But whether it's the wholly imaginary gleam, some intersecting waveform between two fluorescent bulbs, or just the mysterious ways of method acting, now I actually <em>do</em> feel a headache building.","\n","^</p>","\n","^<p>","\n","^An aura forms in the half-light.","\n","^</p>","\n","^<p>","\n","^Shapes dance inside each other. In the corner of my eye, and only when looking away, I swear I see the shape of a man in the wall, tall and dark, looking down at us with crossed arms, pursed lips, devoted eyes.","\n","^</p>","\n",[["ev",{"^->":"chapter_04_third_question.0.c-2.55.0.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"No, I\'m fine now."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_third_question.0.c-2.55.1.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"I just need another minute."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_third_question.0.c-2.55.2.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"I\'ll take something for the pain."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_third_question.0.c-2.55.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.0.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Glad to hear it."',"\n","^</p>","\n",{"->":".^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_third_question.0.c-2.55.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.1.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Take it, I\'ll be silent."',"\n","^</p>","\n",{"->":".^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_third_question.0.c-2.55.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.2.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Okay, I\'ll have someone come in. Just close your eyes and relax until then."',"\n","^</p>","\n","^<p>","\n","^Several agonizing minutes pass. A woman in scrubs walks in and hands the interviewer a paper cup, just barely rattling with a pill or two inside, and a plastic bottle of water. Then she departs, and the pneumatic hiss of the door echoes after her.","\n","^</p>","\n","^<p>","\n","^\"Here. These are not narcotic, but they will block neuropathic pain to an extent. Sorry if that disappoints. The fun stuff will have to wait for later, because if you're having fun, sadly, I'm not. It'll fudge the results.\"","\n","^</p>","\n","^<p>","\n",'^Drat. Unjackpot. Big whammy. Until after this "test," at least.',"\n","^</p>","\n",{"->":".^.^.g-0"},{"#f":5}],"g-0":["^<p>","\n","^\"I'll just go ahead now and write this out as confounded.","\n","^</p>","\n","ev",{"VAR?":"confused_score"},1,"+",{"VAR=":"confused_score",re:!0},"/ev",{"->":".^.^.^.^.g-0"},{"#f":5}]}],{"#f":5}],"g-0":["ev","void","/ev","->->",{"#f":5}]}],{"#f":1}],chapter_04_fourth_question:[["^<p>","\n","ev",{"CNT?":"chapter_04_third_question.0.c-0"},"/ev",[{"->":".^.b",c:!0},{b:['^"',{"->":".^.^.^.6"},null]}],"nop","^It's alright if you don't get this one exactly right, it's a bigger one.\"","\n","^</p>","\n",["ev",{"^->":"chapter_04_fourth_question.0.11.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Okay."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.12.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"I\'ll give it the effort it deserves."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.13.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"That makes me feel... not better."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_fourth_question.0.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.11.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_fourth_question.0.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.12.s"},[{"#n":"$r2"}],"\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_fourth_question.0.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.13.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Why so?"',"\n","^</p>","\n","^<p>","\n",'^"Hilariously, for such a loser, I\'ve always taken losing poorly. Gotta get the high score, barely even matters what it is."',"\n","^</p>","\n","^<p>","\n",'^"Funny enough. But remember, I\'ve always heard funnier, always heard worse, always heard dumber."',"\n","^</p>","\n","^<p>","\n",'^"The comfort of crowds, at long last."',"\n","^</p>","\n","ev",{"VAR?":"confused_score"},1,"+",{"VAR=":"confused_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"g-0":["^<p>","\n",'^"So. The question.',"\n","^</p>","\n","^<p>","\n","^You were trained in your childhood, and were awarded merits for expertise, in the following disciplines:","\n","^</p>","\n","^<ul>","\n","^<li>Hunting.</li>","\n","^<li>Fishing.</li>","\n","^<li>Several foreign languages.</li>","\n","^<li>Riflery.</li>","\n","^<li>Shotguns.</li>","\n","^<li>Pistols.</li>","\n","^<li>Archery.</li>","\n","^<li>Computing and informational technology.</li>","\n","^<li>Knots.</li>","\n","^<li>Gardening.</li>","\n","^<li>Camping, foraging, deep bush hiking, and mountaineering.</li>","\n","^<li>Cutting, woodworking, preparing foodstuffs, and producing materiel with a variety of knives.</li>","\n","^<li>Cooking and firestarting, with available sources and wood campfires.</li>","\n","^<li>The care and handling of various national flags.</li>","\n","^<li>First aid.</li>","\n","^<li>Lifesaving, including CPCR and drowner rescue.</li>","\n","^<li>Swimming, from 50 meters to one kilometer.</li>","\n","^<li>Automobile and small passenger f-wing repair.</li>","\n","^<li>Duty and reverence.</li>","\n","^<li>Navigation by compass, waterline, stars, and solar position.</li>","\n","^<li>Kayaks, rowboats, sailboats, motorboats, and small electromechanical watercraft.</li>","\n","^<li>Public service.</li>","\n","^</ul>","\n","^<p>","\n",'^Is that accurate?"',"\n","^</p>","\n",["ev",{"^->":"chapter_04_fourth_question.0.g-0.66.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-3",flg:18},{s:['^"Um, yeah."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.g-0.67.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-4",flg:18},{s:['^"No, that\'s a huge exaggeration."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.g-0.68.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-5",flg:18},{s:['^"Do you mean the Golden Rangers?"',{"->":"$r",var:!0},null]}],{"c-3":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-3.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.66.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Yes, it\'s complete."',"\n","^</p>","\n","^<p>","\n",'^"Thank you. One more pass, one question closer to some free time, huh? Just let me know if it gets too much, we can take a break or pick back up tomorrow. There is no rush needed in the work of perfection."',"\n","^</p>","\n","^<p>","\n",'^"Thanks. That\'s a useful reminder. I guess."',"\n","^</p>","\n","^<p>","\n","^\"Sometimes guessing is the best one can do. You give us that much, we're here to help with the rest.","\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.^.g-1"},{"#f":5}],"c-4":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-4.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.67.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Okay. Clearly it's a huge <em>something</em>, from what I'm seeing in the readout. Marking a fail and moving on. Careful not to get too excited, we'll have to start over. The results are only good in a certain band, and you're outside of it right now.\"","\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",[["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-4.19.0.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Okay."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-4.19.1.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"I\'m big-time fed up with this."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-4.19.2.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"I will focus on calm. Sorry."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-4.19.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.0.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Great. Thank you very much, Hank.',"\n","^</p>","\n",{"->":".^.^.^.^.^.g-1"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-4.19.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.1.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"I\'m going home."',"\n","^</p>","\n","^<p>","\n",'^"Hank. Are you sure? Really?"',"\n","^</p>","\n","^<p>","\n","^\"Then I'm gonna steal some cough medicine from the bodega and I'll just get so high I imagine a better cult than this. Bye.\"","\n","^</p>","\n","^<p>","\n",'^"Alright then. Sorry we couldn\'t be of more help. And good luck."',"\n","^</p>","\n","ev","str","^chapter-negative-1","/str","/ev",{"->":"done"},{"->":".^.^.^.^.^.g-1"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-4.19.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.2.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"No problem. Not feeling is not the point, not precisely, but in this, as everything, there are certain limits."',"\n","^</p>","\n","^<p>","\n",'^"Understood."',"\n","^</p>","\n","^<p>","\n",'^"Great.',"\n","^</p>","\n",{"->":".^.^.^.^.^.g-1"},{"#f":5}]}],{"#f":5}],"c-5":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-5.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.68.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Yes, the Golden Rangers. Is that a mostly accurate summary of what you were taught and excelled at in the Golden Rangers? It's fine if you don't remember it, I'll write it in as confounded.\"","\n","^</p>","\n",[["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-5.13.0.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Then yes."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-5.13.1.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"Then no."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-5.13.2.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"I guess?"',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-5.13.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.0.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Thank you, Hank.',"\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.^.^.^.g-1"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-5.13.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.1.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Okay. The datasheet might be wrong, but either way, you're peaking at fail.","\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.^.^.^.g-1"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_fourth_question.0.g-0.c-5.13.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.2.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Maybe it's just hearing it all in one go. It sure is a lot. So I guess I don't remember well enough to say.\"","\n","^</p>","\n","^<p>","\n","^\"That's fine. I'm going to mark this down as confounded. Moving on.","\n","^</p>","\n",{"->":".^.^.^.^.^.g-1"},{"#f":5}]}],{"#f":5}],"#f":5}],"g-1":["ev","void","/ev","->->",{"#f":5}]}],{"#f":1}],chapter_04_fifth_question:[["^<p>","\n",'^This is a simple one again. When you were in the Golden Rangers, you were initiated into an elite, high-performing subgroup publicly known as the Broken Arrow Brigade. Yes or no?"',"\n","^</p>","\n",["ev",{"^->":"chapter_04_fifth_question.0.6.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"That\'s accurate."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fifth_question.0.7.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"No, that was my brother."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fifth_question.0.8.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"I... maybe? It rings a bell."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_fifth_question.0.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.6.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Good."',"\n","^</p>","\n","^<p>","\n",'^"Is it?"',"\n","^</p>","\n","^<p>","\n","^\"In that we're one question closer to the end, yes. Otherwise, not my field, not my flower.","\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_fifth_question.0.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.7.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"I see. That's not what this says. And there's a lot here.\"","\n","^</p>","\n","^<p>","\n",'^"I may have gotten plenty of badges and awards, but that was for the fun stuff, the guns and knives and fire, not clearing brush in monastic silence and chanting secret mottos."',"\n","^</p>","\n","^<p>","\n",'^"Okay. So that would be... Paul Holder. One moment.',"\n","^</p>","\n","^<p>","\n","^I'm marking this down as a... no, wait. Okay, no. Okay. Got it. Writing it down as confounded. Sorry about that. Let's move on.","\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_fifth_question.0.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.8.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Okay. There\'s a followup listed here for moderate passes. Do you remember the Brigadier who was assigned to guard you in your duties, as custom dictates?"',"\n","^</p>","\n",[["ev",{"^->":"chapter_04_fifth_question.0.c-2.13.0.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-0",flg:18},{s:['^"Yes."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fifth_question.0.c-2.13.1.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-1",flg:18},{s:['^"No."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_fifth_question.0.c-2.13.2.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str","/ev",{"*":".^.^.c-2",flg:18},{s:['^"Still fuzzy. Sorry."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_fifth_question.0.c-2.13.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.0.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Okay then. Moderate pass it is.',"\n","^</p>","\n","ev",{"VAR?":"convert_score"},1,"+",{"VAR=":"convert_score",re:!0},"/ev",{"->":".^.^.^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_fifth_question.0.c-2.13.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.1.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"Okay. Marking down a fail.',"\n","^</p>","\n","ev",{"VAR?":"resister_score"},1,"+",{"VAR=":"resister_score",re:!0},"/ev",{"->":".^.^.^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_fifth_question.0.c-2.13.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.2.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"No need for apologies. I\'ll mark it as a confound."',"\n","^</p>","\n","^<p>","\n",'^"Thanks."',"\n","^</p>","\n","^<p>","\n",'^"No need for that either. Just my role here.',"\n","^</p>","\n","ev",{"VAR?":"confused_score"},1,"+",{"VAR=":"confused_score",re:!0},"/ev",{"->":".^.^.^.^.g-0"},{"#f":5}]}],{"#f":5}],"g-0":["ev","void","/ev","->->",{"#f":5}]}],{"#f":1}],chapter_04_sixth_question:[[["ev",{"CNT?":"chapter_04_fifth_question.0.c-1"},"/ev",{"->":".^.b",c:!0},{b:["\n","^<p>","\n","^I still have to ask the next part, unfortunately.","\n","^</p>","\n",{"->":".^.^.^.1"},null]}],"nop","\n","^<p>","\n",'^This is a two-parter. When you were a member of the Broken Arrow Brigade, in the second initiation. Do you remember the knife? And do you remember what they did with it?"',"\n","^</p>","\n",["ev",{"^->":"chapter_04_sixth_question.0.9.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str",{"CNT?":"chapter_04_fifth_question.0.c-1"},"/ev",{"*":".^.^.c-0",flg:19},{s:['^"No. Obviously."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_sixth_question.0.10.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str",{"CNT?":"chapter_04_fifth_question.0.c-1"},"/ev",{"*":".^.^.c-1",flg:19},{s:['^"I don\'t know what you expect me to say here."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_sixth_question.0.11.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str",{"CNT?":"chapter_04_fifth_question.0.c-1"},"/ev",{"*":".^.^.c-2",flg:19},{s:['^"I don\'t... maybe?"',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_sixth_question.0.12.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str",{"CNT?":"chapter_04_fifth_question.0.c-1"},"!","/ev",{"*":".^.^.c-3",flg:19},{s:['^"Yes, I remember."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_sixth_question.0.13.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str",{"CNT?":"chapter_04_fifth_question.0.c-1"},"!","/ev",{"*":".^.^.c-4",flg:19},{s:['^"No."',{"->":"$r",var:!0},null]}],["ev",{"^->":"chapter_04_sixth_question.0.14.$r1"},{"temp=":"$r"},"str",{"->":".^.s"},[{"#n":"$r1"}],"/str",{"CNT?":"chapter_04_fifth_question.0.c-1"},"!","/ev",{"*":".^.^.c-5",flg:19},{s:['^(accurate) "I remember the knife."',{"->":"$r",var:!0},null]}],{"c-0":["ev",{"^->":"chapter_04_sixth_question.0.c-0.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.9.s"},[{"#n":"$r2"}],"\n",{"->":".^.^.g-0"},{"#f":5}],"c-1":["ev",{"^->":"chapter_04_sixth_question.0.c-1.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.10.s"},[{"#n":"$r2"}],"\n","^<p>","\n","^\"Please don't worry about it. It's unfortunately just a fairly rigid process. Variables, constants, those sorts of things. I know it's boring, I'm sorry, we're nearly done.\"","\n","^</p>","\n",{"->":".^.^.g-0"},{"#f":5}],"c-2":["ev",{"^->":"chapter_04_sixth_question.0.c-2.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.11.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"I\'ll mark it down as a confound."',"\n","^</p>","\n",{"->":".^.^.g-0"},{"#f":5}],"c-3":["ev",{"^->":"chapter_04_sixth_question.0.c-3.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.12.s"},[{"#n":"$r2"}],"\n",{"->":".^.^.g-0"},{"#f":5}],"c-4":["ev",{"^->":"chapter_04_sixth_question.0.c-4.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.13.s"},[{"#n":"$r2"}],"\n",{"->":".^.^.g-0"},{"#f":5}],"c-5":["ev",{"^->":"chapter_04_sixth_question.0.c-5.$r2"},"/ev",{"temp=":"$r"},{"->":".^.^.14.s"},[{"#n":"$r2"}],"\n","^<p>","\n",'^"I don\'t recall afterwards."',"\n","^</p>","\n","^<p>","\n",'^"Half pass, half fail. Unless more is coming to mind. I\'m seeing some peaks in heart-rate and BP is dropping."',"\n","^</p>","\n",{"->":".^.^.g-0"},{"#f":5}],"g-0":["^<p>","\n","^A migraine is rising at great speed. Lashes of fire against every neuron. Every muscle in my face weeps acid.","\n","^</p>","\n","^<p>","\n",'^"You okay over there?"',"\n","^</p>","\n","ev","void","/ev","->->",{"#f":5}]}],{"#f":1}],chapter_04_outro:["^<p>","\n","^But I'm not, and every year of terror has reached up from the deep to grab me.","\n","^</p>","\n","^<p>","\n","^I fall into something more lightless than a cave, and a glue which no longer exists, not outside memory, keeps me totally mute.","\n","^</p>","\n","^<p>","\n","^I see the boy, the knife, the silent masters. I recall my silence, my nakedness, the cry of the deer I squeezed to nothing, the taste of fresh roe, the volatile smell of isopropyl on bare red flesh. I remember what they put in me, too deep to be perceived by fingers, eyes, lights, or cameras, how it took hold of my heart, and changed my mind.","\n","^</p>","\n","^<p>","\n","^Now I see that which I intended to forget, with Mother watchful and radiant above it all.","\n","^</p>","\n","^<p>","\n","^I am annihilated beyond sense.","\n","^</p>","\n","ev","void","/ev","->->",{"#f":1}],done:[{"temp=":"out_var"},[["ev",{"VAR?":"out_var"},"/ev",{"->":".^.b",c:!0},{b:["\n","ev",{"VAR?":"out_var"},"/ev",{"VAR=":"XLR8R_OUT_PASSAGE",re:!0},{"->":"done.1.1"},null]}],"nop","\n","ev","str","^\u220e","/str","/ev",{"*":".^.c-0",flg:20},{"c-0":["\n",{"->":".^.^.g-0"},{"#f":5}],"g-0":['^<stop-sound group="music" name="stranger-danger" />',"\n","done",{"#f":5}]}],{"#f":1}],"global decl":["ev","str","^XLR8R_PREVIOUS_VALUE","/str",{"VAR=":"DEBUG"},"str","^chapter-05","/str",{"VAR=":"XLR8R_OUT_PASSAGE"},"str","^XLR8R_PREVIOUS_VALUE","/str",{"VAR=":"confused_score"},"str","^XLR8R_PREVIOUS_VALUE","/str",{"VAR=":"convert_score"},"str","^XLR8R_PREVIOUS_VALUE","/str",{"VAR=":"resister_score"},"/ev","end",null],"#f":1}],listDefs:{}},text:'VAR DEBUG = "XLR8R_PREVIOUS_VALUE"\r\n\r\nVAR XLR8R_OUT_PASSAGE = "chapter-05"\r\n\r\nVAR confused_score = "XLR8R_PREVIOUS_VALUE"\r\nVAR convert_score = "XLR8R_PREVIOUS_VALUE"\r\nVAR resister_score = "XLR8R_PREVIOUS_VALUE"\r\n\r\n\r\n-> chapter_04_sound ->\r\n\r\n-> chapter_04_intro ->\r\n\r\n-> chapter_04_first_question ->\r\n\r\n-> chapter_04_second_question ->\r\n\r\n-> chapter_04_third_question ->\r\n\r\n-> chapter_04_fourth_question ->\r\n\r\n-> chapter_04_fifth_question ->\r\n\r\n-> chapter_04_sixth_question ->\r\n\r\n-> chapter_04_outro ->\r\n\r\n-> done("")\r\n\r\n\r\n=== chapter_04_sound ===\r\n<play-sound group="music" name="stranger-danger" />\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_intro ===\r\n<p>\r\n"Hi Hank. It\'s great to finally meet you, I\'m Salome."\r\n</p>\r\n\r\n* "Pleased to meet you."\r\n    <p>\r\n    I walk over to her, reaching out my right hand. She takes it warmly, then drops her hand back to her side. \r\n    </p>\r\n\r\n    <p>\r\n    "Thank you, Hank."\r\n    </p>\r\n\r\n    <p>\r\n    "No problemo."\r\n    </p>\r\n\r\n    ~ convert_score += 1\r\n* "Have I met you before?"\r\n    <p>\r\n    "No, but you may have seen me around. My main role here is to serve as one of the head nurses, so I\'m out and about a lot. It\'s possible you saw me bring someone in from intake while you were waiting?"\r\n    </p>\r\n\r\n    <p>\r\n    "Aha. That must be it, yes."\r\n    </p>\r\n\r\n    ~ confused_score += 1\r\n* ["..."]\r\n    <p>\r\n    Salome fills in what I would not. "Pleased to meet you too, Salome."\r\n    </p>\r\n\r\n    <p>\r\n    She mimes shaking her own hand.\r\n    </p>\r\n\r\n    <p>\r\n    "Hmph. No fair."\r\n    </p>\r\n\r\n    ~ resister_score += 1\r\n-\r\n\r\n<p>\r\n"Sit down. Take a minute to relax. I\'ll just go ahead and fasten all these leads. Clip this to your hand... wrap this around your chest, looking like a bit of healthy growth there\u2014"\r\n</p>\r\n\r\n* "Huh?"\r\n    <p>\r\n    "Oh, nothing, just talking to myself. I thought I saw you at intake the other day, you looked skinny, I guess I misremembered. Sorry! I\'ll keep my mouth shut until I\'m done.\r\n    </p>\r\n\r\n    ~ confused_score += 1\r\n* "What does that mean?"\r\n    <p>\r\n    "It, uhh. Oh, right. Stupid. Nothing. I just haven\'t had coffee yet. You look very healthy, Hank. Sorry to be such a mushmouth about it, I promise it\'s all me.\r\n    </p>\r\n\r\n    ~ resister_score += 1\r\n* ["..."]\r\n    <p>\r\n    "Almost through with this. The clasps are always... tight. This one\'s fighting me.\r\n    </p>\r\n\r\n    ~ convert_score += 1\r\n-\r\n\r\n<p>\r\nAaaand we\'re done. Take a minute to breathe and then we\'ll start. No shocks or pokes, I swear."\r\n</p>\r\n\r\n<p>\r\nShe giggles a bit, too quiet to be for show, then turns to the console. She pushes several buttons with a serious expression.\r\n</p>\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_first_question ===\r\n<p>\r\n"Okay. First question is impossible to fail. Everyone passes, really. So, answer each of these with a yes or no question. Got it? That\'s not the first question, it\'s rhetorical."\r\n</p>\r\n\r\n<p>\r\n"Uh huh."\r\n</p>\r\n\r\n<p>\r\n"First question: is your birth name Hank Holder?"\r\n</p>\r\n\r\n* "Yes."\r\n    <p>\r\n    "Great. Thank you. You\'re doing perfectly.\r\n    </p>\r\n\r\n    ~ convert_score += 1\r\n* "No."\r\n    <p>\r\n    "Well, the system is definitely working. But that\'s a true negative. And, Hank, this is where I deliver my spiel. If you really, really don\'t want to work with us... don\'t. We\'re not jailers, and we\'re not torturers. The door is right there.\r\n    </p>\r\n    \r\n    <p>\r\n    I\'ll be sad to watch you go, but no one\'s going to prevent it. And no one, though I hope this should precede us in our reputation and how you\'ve been treated thus far, will come in the night, with a potato sack and an assault syringe, to steal you back.\r\n    </p>\r\n    \r\n    <p>\r\n    It\'s just too clich\xe9 for us, and I\'d like to think we\'re at least a bit cooler than that. More \'new religious movement\' than \'mystery cult.\' Just a new way of doing good, by getting in touch with the old ways. I promise."\r\n    </p>\r\n\r\n    <p>\r\n    "Got it, five by five."\r\n    </p>\r\n\r\n    <p>\r\n    "I wouldn\'t be here if this was really about world domination, extraordinary rendition, or experimental mind control. No disrespect to the rockstars of cultism, they surely get enough already, but my story is domestic and simple."\r\n    </p>\r\n\r\n    <p>\r\n    "Glad to hear there\'s no skunkworks brain-bending cocktail or a suicide belt at the end of this."\r\n    </p>\r\n\r\n    <p>\r\n    "Not from me, anyway. That\'s Father\'s and Lystra\'s departments, respectively. And <em>that</em> was a joke, just in case it wasn\'t clear."\r\n    </p>\r\n\r\n    <p>\r\n    "It was."\r\n    </p>\r\n\r\n    <p>\r\n    "The point stands. Make your choice, Mr. Housecat. In or out?"\r\n    </p>\r\n\r\n    ~ resister_score += 1\r\n\r\n    * * "Okay, I\'m out."\r\n        <p>\r\n        "What I came here for was <em>drugs</em>. This..."\r\n        </p>\r\n\r\n        <p>\r\n        Now I spread my arms wide, pointing to the faceless and bleak metal walls, no adornments or beauty, just a silly flag for a nation which doesn\'t exist and never will.\r\n        </p>\r\n\r\n        <p>\r\n        "...is not. This isn\'t drugs. Being interviewed while being hooked up to a laptop is not drugs. It\'s nowhere close to drugs. I came in here with a headache and somehow y\'all have harshed on that like a mellow. You\'re a very weird hippie, I don\'t like hippies, and I\'m so gone it\'s not even funny."\r\n        </p>\r\n\r\n        <p>\r\n        I get up and storm out. Of course I\'m not mad. It\'s just another failed score in a long line, and that I have grown fine with losing at, as long as the hit rate stays high enough. And sometimes, every so often, after I smash my way out of a situation like this, someone will dangle a morsel out the window to get me back. We will see whether they actually think me special, and what sort of treats their Mother offers favored sons made in her image.\r\n        </p>\r\n\r\n        -> done("chapter-negative-1")\r\n    * * "Well, you\'ve got me for now."\r\n        <p>\r\n        "Just an hour more." I wink to sell it. She sells it right back, so naturally I still can\'t tell whether she cares about this at all. Maybe it\'s just a job, and an odd narcissist of a boss, like any other under the sun. What\'s more ordinary than people paid less than they deserve to smile at snarky drug-seekers and lorded over by someone who thinks themself an ascended lifeform?\r\n        </p>\r\n    * * "Sorry. Just got mixed up."\r\n        <p>\r\n        "I have test anxiety."\r\n        </p>\r\n\r\n        <p>\r\n        "It\'s okay. You can think of it less like a psychometric test, which might aim to quantify your general and specific intelligences, and more like an allergy test, where we give you a few common injury-substances in such small doses as to be nearly homeopathic, and note where it gets a bit red. Hasn\'t even needed a needle in a century or more. Won\'t hurt a bit, pinky swear."\r\n        </p>\r\n\r\n        <p>\r\n        "And here I was thinking renunciants in plaguetime would be beyond the simple pinky swear."\r\n        </p>\r\n\r\n        <p>\r\n        "Not yet, friend.\r\n        </p>\r\n* (its_henry_bitch) "Technically, it\'s Henry."\r\n    <p>\r\n    "Okay. Hank\u2014 Henry. I appreciate the level of detail, but it needs to be simpler than that for the readout to work. We\'re not looking for fidelity, just a few binary numbers. This will be marked as a yes, and a pass. I will omit, this one time, the yellow asterisk denoting a moderate pass. Just \'cause I like you. But detail-orientation can conceal neurosis and illness, so it\'s relevant."\r\n    </p>\r\n    \r\n    <p>\r\n    "A test failed in trying too hard. Marvelous. I\'m sure I\'ll do great, it matches a core competency."\r\n    </p>\r\n\r\n    ~ confused_score += 1\r\n-\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_second_question ===\r\n<p>\r\n{not chapter_04_first_question.its_henry_bitch:"}You were born at the Colonial Hospital of Capital. You grew up, primarily, at 61372 Leaside Court, in the Davistown neighborhood of the colonial palace zone."\r\n</p>\r\n\r\n* "No, that doesn\'t sound right."\r\n    ~ confused_score += 0.5\r\n\r\n    <p>\r\n    "Okay. Well, that\'s what it says on the sheet. Can you offer more than that? It looks like we may be approaching the hard fail line, which is useful data. It\'s just, uh... quite early for a total fail.\r\n    </p>\r\n\r\n    * * "How do I fail for saying my address is wrong?"\r\n        ~ resister_score += 0.5\r\n\r\n        <p>\r\n        "It\'s not so much failure in the sense of doing something wrong, don\'t worry. It\'s more just that if all the answers are \'No\' or \'I don\'t know,\' then we have no baseline to test. We surface no data."\r\n        </p>\r\n\r\n        <p>\r\n        "Ah."\r\n        </p>\r\n\r\n        <p>\r\n        "I\'ll just mark it down as a confound instead. And on to the next question.\r\n        </p>\r\n    * * "Sorry."\r\n        ~ convert_score += 0.5\r\n\r\n        <p>\r\n        "That\'s fine. I\'ll just go ahead and mark this down as a confound instead. And on to the next question.\r\n        </p>\r\n    * * "I\'m not sure what to say."\r\n        ~ confused_score += 0.5\r\n\r\n        <p>\r\n        "That\'s fine. Can you at least confirm you lived in Davistown?"\r\n        </p>\r\n\r\n        * * * "Yes."\r\n            ~ convert_score += 0.5\r\n\r\n            <p>\r\n            "Thank you. This one goes in as a... soft pass, and we\'re done, and moving on.\r\n            </p>\r\n        * * * "No."\r\n            ~ resister_score += 0.5\r\n\r\n            <p>\r\n            "Thank you. Moving on.\r\n            </p>\r\n        * * * "I can\'t remember that far back."\r\n            ~ confused_score += 0.5\r\n\r\n            <p>\r\n            "That\'s fine. I\'ll mark it down as a confound instead of a fail, and we can move on to the next question.\r\n            </p>\r\n* (upsell) "That wasn\'t the name of the capital."\r\n    <p>\r\n\t"It was a colonial name, for a colonial government. But yes."\r\n    </p>\r\n\r\n    <p>\r\n    "That one gets an asterisk. I don\'t really care, I swear I don\'t, I\'m just here to help. But in this case the helping word is this. We can\'t tell you how to be well if you don\'t want to be. There\'s no magic other than that, it\'s just being willing to submit, for an hour, a year, or a lifetime, totally your choice, to a certain flavor of self-examination."\r\n    </p>\r\n\r\n    <p>\r\n    There\'s the upsell. Knew she was a pro. Wonder if they have a downline for indulgences? Like maybe when retirement rolls around she gets an even fancier diamond vehicle if she brings in more than 144,000 converts?\r\n    </p>\r\n\r\n    <p>\r\n    "I can see you thinking, you know. We\'ll go to the next question now."\r\n    </p>\r\n\r\n    <p>\r\n    Oops.\r\n    </p>\r\n\r\n    ~ resister_score += 1\r\n* "Yes."\r\n    <p>\r\n    "Superb. Thank you. On to the next question.\r\n    </p>\r\n\r\n    ~ convert_score += 1\r\n-\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_third_question ===\r\n<p>\r\n{chapter_04_second_question.upsell:"}You are currently sitting in a room inside a hospital operated by the TAV Institute."\r\n</p>\r\n\r\n* (ladies_and_gentlemen_we_are_snarking) "No, I\'m floating in space."\r\n    <p>\r\n    "Very funny. But we could tell if you were that high. You\'d never have moved on here, you\'d be like a comatose interviewee. So I am marking that down as a hard failure, with a note that you\'re the one exciting yourself."\r\n    </p>\r\n\r\n    <p>\r\n    "Oh, I would never. It\'s a sin to excite one\'s self, after all."\r\n    </p>\r\n\r\n    <p>\r\n    "Perhaps we should have a stand-up night. You\'d pass that one with flying colors, I\'m sure."\r\n    </p>\r\n\r\n    <p>\r\n    "And how about that cafeteria food, ladies and gents?"\r\n    </p>\r\n\r\n    ~ resister_score += 1\r\n* "That is correct."\r\n    <p>\r\n    "Excellent. Another one down, and quick. We\'ll have an early dinner yet."\r\n    </p>\r\n\r\n    <p>\r\n    "Cornbread again, heavenly matriarch willing."\r\n    </p>\r\n\r\n    <p>\r\n    "There\'s the spirit. We\'ll make a Perfect of you yet, Hank.\r\n    </p>\r\n\r\n    ~ convert_score += 1\r\n* I fake a headache.\r\n    <p>\r\n    Nothing sells better than pain, and I\'m disinterested in playing like a lapdog. So I screw up my face and grit my teeth.\r\n    </p>\r\n\r\n    <p>\r\n    "Are you okay, Hank? I\'m getting a weird spike over here, and you\'re, well, grimacing."\r\n    </p>\r\n\r\n    <p>\r\n    "Yeah. Just. Need. A few seconds."\r\n    </p>\r\n\r\n    <p>\r\n    "Of course. Take your time. And let us know if you need anything for the pain."\r\n    </p>\r\n\r\n    <p>\r\n    Jackpot. I see gold.\r\n    </p>\r\n\r\n    <p>\r\n    But whether it\'s the wholly imaginary gleam, some intersecting waveform between two fluorescent bulbs, or just the mysterious ways of method acting, now I actually <em>do</em> feel a headache building.\r\n    </p>\r\n    \r\n    <p>\r\n    An aura forms in the half-light.\r\n    </p>\r\n    \r\n    <p>\r\n    Shapes dance inside each other. In the corner of my eye, and only when looking away, I swear I see the shape of a man in the wall, tall and dark, looking down at us with crossed arms, pursed lips, devoted eyes.\r\n    </p>\r\n    \r\n    * * "No, I\'m fine now."\r\n        <p>\r\n        "Glad to hear it."\r\n        </p>\r\n    * * "I just need another minute."\r\n        <p>\r\n        "Take it, I\'ll be silent."\r\n        </p>\r\n    * * "I\'ll take something for the pain."\r\n        <p>\r\n        "Okay, I\'ll have someone come in. Just close your eyes and relax until then."\r\n        </p>\r\n\r\n        <p>\r\n        Several agonizing minutes pass. A woman in scrubs walks in and hands the interviewer a paper cup, just barely rattling with a pill or two inside, and a plastic bottle of water. Then she departs, and the pneumatic hiss of the door echoes after her.\r\n        </p>\r\n\r\n        <p>\r\n        "Here. These are not narcotic, but they will block neuropathic pain to an extent. Sorry if that disappoints. The fun stuff will have to wait for later, because if you\'re having fun, sadly, I\'m not. It\'ll fudge the results."\r\n        </p>\r\n\r\n        <p>\r\n        Drat. Unjackpot. Big whammy. Until after this "test," at least.\r\n        </p>\r\n    - -\r\n\r\n    <p>\r\n    "I\'ll just go ahead now and write this out as confounded.\r\n    </p>\r\n\r\n    ~ confused_score += 1\r\n-\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_fourth_question ===\r\n<p>\r\n{chapter_04_third_question.ladies_and_gentlemen_we_are_snarking:"}It\'s alright if you don\'t get this one exactly right, it\'s a bigger one."\r\n</p>\r\n\r\n* "Okay."\r\n    ~ convert_score += 1\r\n* "I\'ll give it the effort it deserves."\r\n    ~ resister_score += 1\r\n* "That makes me feel... not better."\r\n    <p>\r\n    "Why so?"\r\n    </p>\r\n\r\n    <p>\r\n    "Hilariously, for such a loser, I\'ve always taken losing poorly. Gotta get the high score, barely even matters what it is."\r\n    </p>\r\n\r\n    <p>\r\n    "Funny enough. But remember, I\'ve always heard funnier, always heard worse, always heard dumber."\r\n    </p>\r\n\r\n    <p>\r\n    "The comfort of crowds, at long last."\r\n    </p>\r\n\r\n    ~ confused_score += 1\r\n-\r\n\r\n<p>\r\n"So. The question.\r\n</p>\r\n\r\n<p>\r\nYou were trained in your childhood, and were awarded merits for expertise, in the following disciplines:\r\n</p>\r\n\r\n<ul>\r\n    <li>Hunting.</li>\r\n    <li>Fishing.</li>\r\n    <li>Several foreign languages.</li>\r\n    <li>Riflery.</li>\r\n    <li>Shotguns.</li>\r\n    <li>Pistols.</li>\r\n    <li>Archery.</li>\r\n    <li>Computing and informational technology.</li>\r\n    <li>Knots.</li>\r\n    <li>Gardening.</li>\r\n    <li>Camping, foraging, deep bush hiking, and mountaineering.</li>\r\n    <li>Cutting, woodworking, preparing foodstuffs, and producing materiel with a variety of knives.</li>\r\n    <li>Cooking and firestarting, with available sources and wood campfires.</li>\r\n    <li>The care and handling of various national flags.</li>\r\n    <li>First aid.</li>\r\n    <li>Lifesaving, including CPCR and drowner rescue.</li>\r\n    <li>Swimming, from 50 meters to one kilometer.</li>\r\n    <li>Automobile and small passenger f-wing repair.</li>\r\n    <li>Duty and reverence.</li>\r\n    <li>Navigation by compass, waterline, stars, and solar position.</li>\r\n    <li>Kayaks, rowboats, sailboats, motorboats, and small electromechanical watercraft.</li>\r\n    <li>Public service.</li>\r\n</ul>\r\n\r\n<p>\r\nIs that accurate?"\r\n</p>\r\n\r\n* "Um, yeah."\r\n    <p>\r\n    "Yes, it\'s complete."\r\n    </p>\r\n\r\n    <p>\r\n    "Thank you. One more pass, one question closer to some free time, huh? Just let me know if it gets too much, we can take a break or pick back up tomorrow. There is no rush needed in the work of perfection."\r\n    </p>\r\n\r\n    <p>\r\n    "Thanks. That\'s a useful reminder. I guess."\r\n    </p>\r\n\r\n    <p>\r\n    "Sometimes guessing is the best one can do. You give us that much, we\'re here to help with the rest.\r\n    </p>\r\n\r\n    ~ convert_score += 1\r\n* (exaggeration) "No, that\'s a huge exaggeration."\r\n    <p>\r\n    "Okay. Clearly it\'s a huge <em>something</em>, from what I\'m seeing in the readout. Marking a fail and moving on. Careful not to get too excited, we\'ll have to start over. The results are only good in a certain band, and you\'re outside of it right now."\r\n    </p>\r\n\r\n    ~ resister_score += 1\r\n\r\n    * * "Okay."\r\n        <p>\r\n        "Great. Thank you very much, Hank.\r\n        </p>\r\n    * * "I\'m big-time fed up with this."\r\n        <p>\r\n        "I\'m going home."\r\n        </p>\r\n\r\n        <p>\r\n        "Hank. Are you sure? Really?"\r\n        </p>\r\n\r\n        <p>\r\n        "Then I\'m gonna steal some cough medicine from the bodega and I\'ll just get so high I imagine a better cult than this. Bye."\r\n        </p>\r\n\r\n        <p>\r\n        "Alright then. Sorry we couldn\'t be of more help. And good luck."\r\n        </p>\r\n\r\n        -> done("chapter-negative-1")\r\n    * * "I will focus on calm. Sorry."\r\n        <p>\r\n        "No problem. Not feeling is not the point, not precisely, but in this, as everything, there are certain limits."\r\n        </p>\r\n\r\n        <p>\r\n        "Understood."\r\n        </p>\r\n\r\n        <p>\r\n        "Great.\r\n        </p>\r\n* "Do you mean the Golden Rangers?"\r\n    <p>\r\n    "Yes, the Golden Rangers. Is that a mostly accurate summary of what you were taught and excelled at in the Golden Rangers? It\'s fine if you don\'t remember it, I\'ll write it in as confounded."\r\n    </p>\r\n\r\n    * * "Then yes."\r\n        <p>\r\n        "Thank you, Hank.\r\n        </p>\r\n\r\n        ~ convert_score += 1\r\n    * * "Then no."\r\n        <p>\r\n        "Okay. The datasheet might be wrong, but either way, you\'re peaking at fail.\r\n        </p>\r\n\r\n        ~ resister_score += 1\r\n    * * "I guess?"\r\n        <p>\r\n        "Maybe it\'s just hearing it all in one go. It sure is a lot. So I guess I don\'t remember well enough to say."\r\n        </p>\r\n\r\n        <p>\r\n        "That\'s fine. I\'m going to mark this down as confounded. Moving on.\r\n        </p>\r\n-\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_fifth_question ===\r\n<p>\r\nThis is a simple one again. When you were in the Golden Rangers, you were initiated into an elite, high-performing subgroup publicly known as the Broken Arrow Brigade. Yes or no?"\r\n</p>\r\n\r\n* "That\'s accurate."\r\n    <p>\r\n    "Good."\r\n    </p>\r\n\r\n    <p>\r\n    "Is it?"\r\n    </p>\r\n\r\n    <p>\r\n    "In that we\'re one question closer to the end, yes. Otherwise, not my field, not my flower.\r\n    </p>\r\n\r\n    ~ convert_score += 1\r\n* (brother) "No, that was my brother."\r\n    <p>\r\n    "I see. That\'s not what this says. And there\'s a lot here."\r\n    </p>\r\n\r\n    <p>\r\n    "I may have gotten plenty of badges and awards, but that was for the fun stuff, the guns and knives and fire, not clearing brush in monastic silence and chanting secret mottos."\r\n    </p>\r\n\r\n    <p>\r\n    "Okay. So that would be... Paul Holder. One moment.\r\n    </p>\r\n    \r\n    <p>\r\n    I\'m marking this down as a... no, wait. Okay, no. Okay. Got it. Writing it down as confounded. Sorry about that. Let\'s move on.\r\n    </p>\r\n\r\n    ~ resister_score += 1\r\n* "I... maybe? It rings a bell."\r\n    <p>\r\n    "Okay. There\'s a followup listed here for moderate passes. Do you remember the Brigadier who was assigned to guard you in your duties, as custom dictates?"\r\n    </p>\r\n\r\n    * * "Yes."\r\n        <p>\r\n        "Okay then. Moderate pass it is.\r\n        </p>\r\n\r\n        ~ convert_score += 1\r\n    * * "No."\r\n        <p>\r\n        "Okay. Marking down a fail.\r\n        </p>\r\n\r\n        ~ resister_score += 1\r\n    * * "Still fuzzy. Sorry."\r\n        <p>\r\n        "No need for apologies. I\'ll mark it as a confound."\r\n        </p>\r\n\r\n        <p>\r\n        "Thanks."\r\n        </p>\r\n\r\n        <p>\r\n        "No need for that either. Just my role here.\r\n        </p>\r\n\r\n        ~ confused_score += 1\r\n-\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_sixth_question ===\r\n{\r\n    - chapter_04_fifth_question.brother:\r\n        <p>\r\n        I still have to ask the next part, unfortunately.\r\n        </p>\r\n}\r\n\r\n<p>\r\nThis is a two-parter. When you were a member of the Broken Arrow Brigade, in the second initiation. Do you remember the knife? And do you remember what they did with it?"\r\n</p>\r\n\r\n* {chapter_04_fifth_question.brother} "No. Obviously."\r\n* {chapter_04_fifth_question.brother} "I don\'t know what you expect me to say here."\r\n    <p>\r\n    "Please don\'t worry about it. It\'s unfortunately just a fairly rigid process. Variables, constants, those sorts of things. I know it\'s boring, I\'m sorry, we\'re nearly done."\r\n    </p>\r\n* {chapter_04_fifth_question.brother} "I don\'t... maybe?"\r\n    <p>\r\n    "I\'ll mark it down as a confound."\r\n    </p>\r\n* {not chapter_04_fifth_question.brother} "Yes, I remember."\r\n* {not chapter_04_fifth_question.brother} "No."\r\n* {not chapter_04_fifth_question.brother} (accurate) "I remember the knife."\r\n    <p>\r\n    "I don\'t recall afterwards."\r\n    </p>\r\n\r\n    <p>\r\n    "Half pass, half fail. Unless more is coming to mind. I\'m seeing some peaks in heart-rate and BP is dropping."\r\n    </p>\r\n-\r\n\r\n<p>\r\nA migraine is rising at great speed. Lashes of fire against every neuron. Every muscle in my face weeps acid.\r\n</p>\r\n\r\n<p>\r\n"You okay over there?"\r\n</p>\r\n\r\n->->\r\n\r\n\r\n=== chapter_04_outro ===\r\n<p>\r\nBut I\'m not, and every year of terror has reached up from the deep to grab me.\r\n</p>\r\n\r\n<p>\r\nI fall into something more lightless than a cave, and a glue which no longer exists, not outside memory, keeps me totally mute.\r\n</p>\r\n\r\n<p>\r\nI see the boy, the knife, the silent masters. I recall my silence, my nakedness, the cry of the deer I squeezed to nothing, the taste of fresh roe, the volatile smell of isopropyl on bare red flesh. I remember what they put in me, too deep to be perceived by fingers, eyes, lights, or cameras, how it took hold of my heart, and changed my mind.\r\n</p>\r\n\r\n<p>\r\nNow I see that which I intended to forget, with Mother watchful and radiant above it all.\r\n</p>\r\n\r\n<p>\r\nI am annihilated beyond sense.\r\n</p>\r\n\r\n->->\r\n\r\n\r\n=== done(out_var) ===\r\n{\r\n    - out_var:\r\n        ~ XLR8R_OUT_PASSAGE = out_var\r\n}\r\n\r\n* [\u220e]\r\n-\r\n\r\n<stop-sound group="music" name="stranger-danger" />\r\n\r\n-> DONE'}}}]);